                         <input type="text" name= "Url" width="120" height="40"/>
                </td>

                <td>
                        <label>Versions : </label>
                    </td>

                <td>
                 <select id = "versions" name="versions" width="120" height="40">
                 {this.state.versionlst.versions.map((item) => <option key={item} value={item}>{item}</option>)}
                </select>
                </td>
                
                <td>
                        <label>Name : </label>
                    </td>
<td>

